import { Route, Routes } from "react-router-dom";
import Landing from "./MainLanding/Landing";
import Prod from "./AllProducts/ProdList";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Landing />} />
      <Route path=":type" element={<Prod />}>
        <Route path=":name" element={<Prod />} />
      </Route>
    </Routes>
  );
}

export default App;
